import styles from "./Navigation.module.css";

const NavigationContainer = () => {
  return (
    <div className={styles.container}>
      <div className={styles.navItems}>1</div>
      <div className={styles.navItems}>2</div>
      <div className={styles.navItems}>3</div>
      <div className={styles.navItems}>4</div>
      <div className={styles.navItems}>5</div>
      <div className={styles.navItems}>6</div>
      <div className={styles.navItems}>7</div>
    </div>
  );
};

export default NavigationContainer;
